import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import coffeeImage from "../assets/coffee-image.png";
import logo from "../assets/logo.png";

// Create page components (you'll need to create these files)
// import Home from "./Home";
import Menu from "./Menu";
import Services from "./Services";
import Contact from "./Contact";
import Login from "./Login";

const CoffeeHouse = () => {
  return (
    <Router>
      <div className="min-h-screen font-sans">
        {/* Header */}
        <header className="bg-[#4a2600] text-white px-10 py-4 flex justify-between items-center">
          <div className="flex items-center gap-2">
            <img src={logo} alt="Logo" className="w-20 h-16 object-contain" />
          </div>
          <nav>
            <ul className="flex gap-8 text-sm font-semibold">
              <li><Link to="/" className="hover:text-amber-200 transition-colors">HOME</Link></li>
              <li><Link to="/menu" className="hover:text-amber-200 transition-colors">MENU</Link></li>
              <li><Link to="/services" className="hover:text-amber-200 transition-colors">SERVICES</Link></li>
              <li><Link to="/contact" className="hover:text-amber-200 transition-colors">CONTACT</Link></li>
            </ul>
          </nav>
          <Link
            to="/login"
            className="bg-[#8a4b27] px-4 py-2 rounded-full shadow-md font-semibold hover:bg-[#6e3a1f] transition-colors"
          >
            LOGIN
          </Link>
        </header>

        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/menu" element={<Menu />} />
          <Route path="/services" element={<Services />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/login" element={<Login />} />
        </Routes>
      </div>
    </Router>
  );
};

// Home page component (moved from original CoffeeHouse)
const HomePage = () => {
  return (
    <main className="flex flex-col lg:flex-row min-h-[calc(100vh-80px)]">
      {/* Left Side - Content */}
      <div className="flex-1 p-10 text-white bg-cover bg-left relative z-10"
        style={{ backgroundImage: "url('./assets/coffee-bg.jpg')" }}>
        <div className="flex flex-col justify-between h-full">
          <div>
            <h1 className="text-6xl font-extrabold leading-none">
              COFFEE <br />
              <span className="text-6xl font-outline text-transparent stroke-white">
                HOUSE
              </span>
            </h1>
          </div>

          <div className="mt-10 text-sm uppercase">
            <p className="text-xs">Khusus Hari Ini Saja!!!</p>
            <h2 className="text-4xl font-bold mt-2">
              Diskon <br />
              <span className="text-5xl">50%</span>
            </h2>
          </div>

          <div className="mt-10 text-sm leading-relaxed">
            <h3 className="font-bold mb-2 text-lg">TALK TO US</h3>
            <p>
              (04) 298 3985 2092 <br />
              +76 209 1092 4095 <br />
              <a href="mailto:info@mollysrestaurant.com" className="underline hover:text-amber-200">
                info@mollysrestaurant.com
              </a>
            </p>
          </div>
        </div>
      </div>

      {/* Right Side - Coffee Image */}
      <div className="flex-1 relative bg-white overflow-hidden flex items-center justify-center">
        <img
          src={coffeeImage}
          alt="Coffee Cups"
          className="h-full w-auto max-w-full object-contain"
          style={{ maxHeight: "calc(100vh - 80px)" }}
        />
      </div>
    </main>
  );
};

export default CoffeeHouse;
